import { NavLink } from "react-router-dom";
import styles from "./styles.module.css";
import img1 from "../Images/home.jpg"
import Footer from "../footer/index";
const Main = () => {
	const handleLogout = () => {
		localStorage.removeItem("token");
		window.location.reload();
	};

	return (
		<div className={styles.main_container}>
			<nav className={styles.navbar}>
				{/* Left Section with Logo */}
				<div className={styles.content_text}>
  <span className={styles.letter}>L</span>
  <span className={styles.letter}>E</span>
  <span className={styles.letter}>A</span>
  <span className={styles.letter}>R</span>
  <span className={styles.letter}>N</span>
  <span className={styles.letter}>Z</span>
</div>

				{/* Right Section with Navigation Links and Logout Button */}
				<div className={styles.nav_links_container}>
					<div className={styles.nav_links}>
						{/* Home Link */}
						<NavLink
							to="/"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Home
						</NavLink>

						{/* Courses Link */}
						<NavLink
							to="/courses"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Courses
						</NavLink>

						{/* Contact Link */}
						<NavLink
							to="/contact"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Contact
						</NavLink>

						{/* About Link */}
						<NavLink
							to="/about"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							About
						</NavLink>
					</div>

					{/* Logout Button */}
                    <div className="login-bar"><p>|</p>
                    </div>
					<button className={styles.white_btn} onClick={handleLogout}>
                    Logout
					</button>
				</div>
			</nav>

			<div className={styles.content}>
  <div className={styles.content_text}>
    <p>Welcome to Learnz, your journey begins here!</p>
    <button className={styles.content_button}>Get Started</button>
  </div>



			</div>
			<Footer/>
		</div>
	);
};

export default Main;
